import React from 'react';

export default function Project(props) {
  const cardStyle = {
    width: '18rem',
  };
    return (
      <div className="container">
        <div className="card" style={cardStyle}></div>
        <h1>{props.title}</h1>
        <p>{props.description}
        </p>
        <img  src={props.image} />
        <a href={props.deployedLink}>Deployed Link</a>
        <a href={props.githubLink}>Github Link</a>
      </div>
    );
  }
